---
commands:
  modules:
    childData:
      type: "branch"
      childs:
        load:
          childData:
            type: "string"
            regex: ".*"
            name: "name"
          executorKey: "load"
        unload:
          childData:
            type: "string"
            regex: ".*"
            name: "name"
          executorKey: "unload"
        loaded:
          executorKey: "loaded"